import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
    const navigate = useNavigate();

    useEffect(() => {
        // Check if userId is present in localStorage
        const userId = localStorage.getItem('userId');
        if (!userId) {
            navigate('/'); // Redirect to home if userId is not present
        }
    }, [navigate]);

    return (
        <div className="p-6 bg-purple-100 h-full">
            <h2 className="text-2xl font-bold mb-4">Dashboard</h2>
            <div className="flex justify-between space-x-4">
                {/* Rectangle 1 */}
                <div className="w-1/4 h-96 pup rounded-lg shadow-md flex items-center justify-center text-white">
                    <div>
                    <p>Follow Up</p>
                    </div>
                </div>

                {/* Rectangle 2 */}
                <div className="w-1/4 h-96 pup rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Open Tasks</p>
                </div>

                {/* Rectangle 3 */}
                <div className="w-1/4 h-96 pup rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Contact Made</p>
                </div>

                {/* Rectangle 4 */}
                <div className="w-1/4 h-96 pup rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Rejected</p>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
